bench_iter_t  bench_byte_range( uint32_t start, uint32_t stop) {
    uint16_t* lo = BENCH_BYTE_INDEX;
    uint16_t*  hi = BENCH_BYTE_INDEX + BENCH_BYTE_INDEX_COUNT;
    while( lo < hi ){
        uint16_t*  mid = lo + ( hi-lo)/2;
        if( start>BENCH_TABLE[*mid].byte_  ){
             lo = mid + 1;
        } else {
             hi = mid;
        }
    }

    uint16_t*  begin = lo;
    hi = BENCH_BYTE_INDEX + BENCH_BYTE_INDEX_COUNT;
    while( lo < hi ){
         uint16_t* mid = lo + ( hi-lo)/2;
        if( stop<BENCH_TABLE[*mid].byte_  ){
            hi = mid;
        } else {
            lo = mid + 1;
        }
    }

    bench_iter_t res = {  begin,  lo };
    return res;
}
