bench_iter_t  bench_str_range( const char* start, const char* stop) {
    uint16_t* lo = BENCH_STR_INDEX;
    uint16_t*  hi = BENCH_STR_INDEX + BENCH_STR_INDEX_COUNT;
    while( lo < hi ){
        uint16_t*  mid = lo + ( hi-lo)/2;
        if( strcmp(start,BENCH_TABLE[*mid].str_ )>0 ){
             lo = mid + 1;
        } else {
             hi = mid;
        }
    }

    uint16_t*  begin = lo;
    hi = BENCH_STR_INDEX + BENCH_STR_INDEX_COUNT;
    while( lo < hi ){
         uint16_t* mid = lo + ( hi-lo)/2;
        if( strcmp(stop,BENCH_TABLE[*mid].str_ )<0 ){
            hi = mid;
        } else {
            lo = mid + 1;
        }
    }

    bench_iter_t res = {  begin,  lo };
    return res;
}
